// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar'; // Navbar component if you have one
import LoginForm from './pages/pasindu/LoginForm'; // Import LoginForm

const App = () => {
    return (
        <Router>
            <div className="App">
                <Navbar /> {/* Render Navbar if needed */}
                <Routes>
                    <Route path="/login" element={<LoginForm />} /> {/* Route to the Login page */}
                    {/* Add other routes if needed */}
                </Routes>
            </div>
        </Router>
    );
};

export default App;
